import{_ as i,a as o,af as l,o as a}from"./chunks/framework.C87LdZyP.js";const f=JSON.parse('{"title":"使用 UI 进行 Stable Diffusion 训练","description":"","frontmatter":{"title":"使用 UI 进行 Stable Diffusion 训练","date":"2023-02-15T00:00:00.000Z","tags":["ai","stable-diffusion"],"category":["AI"]},"headers":[],"relativePath":"posts/2023/02/2023-02-15-stable-diffusion-training-in-ui.md","filePath":"posts/2023/02/2023-02-15-stable-diffusion-training-in-ui.md","lastUpdated":1718173059000}'),t={name:"posts/2023/02/2023-02-15-stable-diffusion-training-in-ui.md"};function r(d,e,s,n,c,h){return a(),o("div",null,e[0]||(e[0]=[l('<p>主要介绍使用 <code>AUTOMATIC1111 / stable-diffusion-webui</code> 和 <code>Cmdr2&#39;s Stable Diffusion UI v2</code> 两个 UI 如何来进行 SD 训练。</p><h2 id="使用-automatic1111-stable-diffusion-webui" tabindex="-1">使用 <a href="https://github.com/AUTOMATIC1111/stable-diffusion-webui" target="_blank" rel="noreferrer">AUTOMATIC1111 / stable-diffusion-webui</a> <a class="header-anchor" href="#使用-automatic1111-stable-diffusion-webui" aria-label="Permalink to &quot;使用 [AUTOMATIC1111 / stable-diffusion-webui](https://github.com/AUTOMATIC1111/stable-diffusion-webui)&quot;">​</a></h2><h3 id="fine-tuned-model-checkpoints-dreambooth-models" tabindex="-1">Fine-tuned Model Checkpoints (Dreambooth Models) <a class="header-anchor" href="#fine-tuned-model-checkpoints-dreambooth-models" aria-label="Permalink to &quot;Fine-tuned Model Checkpoints (Dreambooth Models)&quot;">​</a></h3><ol><li>下载自定义模型</li><li>将模型放在 AUTOMATIC1111 Web UI 实例的目录中<code>models/Stable-diffusion</code></li><li>刷新模型列表或重新启动稳定扩散 Web UI</li><li>从输入字段中选择自定义模型<code>Stable Diffusion checkpoint</code></li><li>在提示中使用训练关键字（在自定义模型页面上列出）</li><li>制作图像</li></ol><h3 id="textual-inversions-文本反转" tabindex="-1">Textual Inversions（文本反转） <a class="header-anchor" href="#textual-inversions-文本反转" aria-label="Permalink to &quot;Textual Inversions（文本反转）&quot;">​</a></h3><ol><li>下载 textual inversion</li><li>将文本反转放在 AUTOMATIC1111 Web UI 实例的<code>embeddings</code> 目录中</li><li>在提示中使用经过训练的关键字（在 textual inversion 的页面上列出）</li><li>制作图像</li></ol><h3 id="aesthetic-gradients-美学渐变" tabindex="-1">Aesthetic Gradients (美学渐变) <a class="header-anchor" href="#aesthetic-gradients-美学渐变" aria-label="Permalink to &quot;Aesthetic Gradients (美学渐变)&quot;">​</a></h3><ol><li>安装 <a href="https://github.com/AUTOMATIC1111/stable-diffusion-webui-aesthetic-gradients" target="_blank" rel="noreferrer">Aesthetic Gradients 扩展</a></li><li>下载 Aesthetic Gradients</li><li>将美观的 graident 放在 AUTOMATIC1111 Web UI 实例的目录中aesthetic_embeddings</li><li>重新启动稳定的扩散 Web UI</li><li>调整美学渐变设置</li><li>制作图像</li></ol><h3 id="hypernetwork-超网" tabindex="-1">Hypernetwork（超网） <a class="header-anchor" href="#hypernetwork-超网" aria-label="Permalink to &quot;Hypernetwork（超网）&quot;">​</a></h3><ol><li>下载超网络</li><li>将超网络放在 AUTOMATIC1111 Web UI 实例的目录中 <code>models/hypernetworks</code></li><li>重新启动稳定的扩散 Web UI</li><li>从设置的输入字段中选择虚拟网络 <code>Hypernetwork</code></li><li>使用设置中的范围滑块调整超网络强度(Hypernetwork strength) <code>Hypernetwork strength</code></li><li>制作图像</li></ol><h3 id="lora" tabindex="-1">LoRA <a class="header-anchor" href="#lora" aria-label="Permalink to &quot;LoRA&quot;">​</a></h3><ol><li>下载 LoRA</li><li>将文件放在文件夹中 <code>models/lora</code></li><li>单击<code>Generate</code>（紫色图标） 按钮下方的<code>show extra networks</code> 按钮</li><li>转到<code>Lora</code>选项卡（可能需要刷新）</li><li>单击您要应用的那个，它将添加到提示（prompt）中</li><li><strong>确保调整权重</strong>，默认情况下通常是 <code>:1</code>（这个权重通常太高了）</li></ol><h3 id="locon" tabindex="-1">LoCon <a class="header-anchor" href="#locon" aria-label="Permalink to &quot;LoCon&quot;">​</a></h3><ol><li>确保已安装 <a href="https://github.com/KohakuBlueleaf/a1111-sd-webui-locon" target="_blank" rel="noreferrer">LoCon 扩展</a></li><li>下载定位符</li><li>将文件放在文件夹中<code>models/lora</code></li><li>单击<code>Generate</code>（紫色图标） 按钮下方的<code>show extra networks</code> 按钮</li><li>转到<code>Lora</code>选项卡（可能需要刷新）</li><li>单击您要应用的那个，它将添加到提示（prompt）中</li><li><strong>确保调整权重</strong>，默认情况下通常是 <code>:1</code>（这个权重通常太高了）</li></ol><h3 id="wildcards" tabindex="-1">Wildcards <a class="header-anchor" href="#wildcards" aria-label="Permalink to &quot;Wildcards&quot;">​</a></h3><ol><li>确保已安装 <a href="https://github.com/AUTOMATIC1111/stable-diffusion-webui-wildcards" target="_blank" rel="noreferrer">Wildcards 插件</a></li><li>下载通 Wildcards archive</li><li>将存档解压缩到<code>extensions/stable-diffusion-webui-wildcards/wildcards</code></li><li>在提示中使用一个或多个通配符单词在生成时触发单词替换（例如。<code>__hair-style__</code>)</li></ol><h2 id="cmdr2-s-stable-diffusion-ui-v2" tabindex="-1">Cmdr2&#39;s Stable Diffusion UI v2 <a class="header-anchor" href="#cmdr2-s-stable-diffusion-ui-v2" aria-label="Permalink to &quot;Cmdr2&#39;s Stable Diffusion UI v2&quot;">​</a></h2><h3 id="fine-tuned-model-checkpoints-dreambooth-models-1" tabindex="-1">Fine-tuned Model Checkpoints (Dreambooth Models) <a class="header-anchor" href="#fine-tuned-model-checkpoints-dreambooth-models-1" aria-label="Permalink to &quot;Fine-tuned Model Checkpoints (Dreambooth Models)&quot;">​</a></h3><ul><li>下载 Checkpoint 格式（<code>.ckpt</code>）的自定义模型</li><li>将模型文件放在安装目录的 <code>models\\stable-diffusion</code> 目录中</li><li>重新加载网页以更新模型列表</li><li>从“图像设置”部分的“模型”列表中选择自定义模型</li><li>在提示中使用训练关键字（在自定义模型页面上列出）</li></ul><hr><ul><li><a href="https://github.com/civitai/civitai/wiki/How-to-use-models" target="_blank" rel="noreferrer">How-to-use-models</a></li><li><a href="https://stable-diffusion-ui.github.io/" target="_blank" rel="noreferrer">Cmdr2&#39;s Stable Diffusion UI v2</a></li></ul>',21)]))}const b=i(t,[["render",r]]);export{f as __pageData,b as default};
